import React, {Component} from "react"; 
import "./Navbar.css";


class Navbar extends Component {
    render(){
        return (
            <div className="Navbar">
                <h1 className="Navbar-title">JP Luncumilla</h1>
                <div className="Navbar-menu">
                    <a href="#">About</a> <a href="#">Work</a> <a href="#">Resume</a> <a href="#">Contact</a>
                </div>
            </div>
        )
    }
}

export default Navbar;
